import React from 'react'

export default class TeamSelector extends React.Component {

    getTeamsList() {
        var options = [];
        var teamNames = ['Amiens', 'Angers', 'Bordeaux', 'Berst', 'Dijon', 'Lille', 'Lyon', 'Marseille', 'Metz', 'Monaco', 'Montpellier', 'Nantes', 'Nice', 'Nîmes', 'Paris', 'Reims', 'Rennes', 'Saint-Etienne', 'Strasbourg', 'Toulouse'];
        for (var i = 0; i < teamNames.length; i++) {
            options.push(<div class='option' key={i} value={teamNames[i]}>{teamNames[i]}</div>);
        }
        return options;
    }

    render() {
        return(
            <div className='team-selector'>
                <p>{this.props.value}</p>
                <div class='drop'>
                    <div class='option active placeholder'/>
                    {this.getTeamsList()}
                </div>
            </div>
        )
    }
}
